    return (
        <Container className="project-overview-container">
            <BackHomeButt />
            <Container className="project-cards-container">
                <ProjectCard project_name="Project Gemini" description="Gemini Description" link="https://github.com/jakobap" link_description="Read More"/>
                <ProjectCard text="hello worl2"/>
            </Container>
        </Container>
    )
}

export default ProjectsOverview
